    public ResponseDTO UidDemoValidator(TabRequestDTO td, String id){
        try {
            UIDDemographicBody form=new UIDDemographicBody();
            form.setName(td.getUidDoc().getName());
            form.setYob(td.getUidDoc().getYob());
            form.setUid(td.getUidDoc().getUid());
            form.setClientId(clientId);
            form.setSecurityToken(securityToken);
            //String json = gson.toJson(reqbuilder.UidDemoRequestWrapper(form));
            LosRequest.UIDDemographic requestjson=new LosRequest.UIDDemographic();
            requestjson.setRequest(form);
            requestjson.setOrigin(td.getAppid());
            requestjson.setWorkItemNumber(td.getWinum());
            requestjson.setSlno(td.getSlno());

            String json = gson.toJson(requestjson);
            ResponseEntity<String> response = apiService.IntApiService(url, json, id);
            JsonObject resjson = apiService.losAPIValidator(response, url, id);
            String errormsg="";

            if(resjson.get("msg").getAsString().equals("OK")){
                if(resjson.getAsJsonObject("Body").get("message").getAsString().equals("SUCCESS")) {

                    return new ResponseDTO("S","");
                }
                else {
                    errormsg=Constants.Messages.DEMOGRAPHIC_FAILED;
                }
            }
            else{
                errormsg=resjson.get("msg").getAsString();
            }
            return new ResponseDTO("F",errormsg);
        }
        catch (Exception e){
            e.printStackTrace();
        }
        return new ResponseDTO("F", Constants.Messages.SOMETHING_ERROR);
    }
